import React from 'react';
import { useState } from 'react';
import LoaderHeading from './util/LoaderHeading';
import ExamCard from './util/ExamCard';

function ViewExams() {

    const [fetchedData, setFetchedData] = useState({data: [], count: 0})

    var admins = [];

    async function getData(url) {
        const response = await fetch(url, {
            method: 'GET'
        });
        return response.json(); 
    }


    const loadExams = () => {
        let URL = 'http://localhost:8080/UploadToS3/admins';
        getData(URL)
        .then(data => {
            setFetchedData(data);
        });
    }

    return (
    <>
        <LoaderHeading 
            description='Exams'
        />
        <div className='content-loaded'>
            <div>
                <button onClick={loadExams}>Fetch</button>
                <div>

                </div>
            </div>
        </div>
    </>
    );
}

export default ViewExams;
